# Simpan hex string-nya ke variabel (dipersingkat sebagai contoh)
hex_string = """

""".replace("\n", "").replace(" ", "")  # pastikan tidak ada newline atau spasi

binary_data = bytes.fromhex(hex_string)

# Cari offset di mana "GIF89a" muncul
gif_header = b"GIF89a"
offset = binary_data.find(gif_header)

if offset == -1:
    print("❌ GIF89a tidak ditemukan.")
else:
    print(f"✅ Ditemukan header GIF di offset: {offset}")
    gif_data = binary_data[offset:]
    with open("fixed_output.gif", "wb") as f:
        f.write(gif_data)
    print("🎉 File berhasil disimpan sebagai fixed_output.gif")